### Issue Description

Hi,

My Projects are all Net 6.0.

I have Nuget packages of MSBuild 17.3.2 in the project

When we use MSBuildLocator.RegisterDefaults(); the command "dotnet build" DOES NOT return the correct message, when called from Powershell.

But it returns the correct message if we DO NOT USE MSBuildLocator.RegisterDefaults();

The Code is;

```c#
                string errMessageOfPowerShell = String.Empty;
                PowerShell powerShell = PowerShell.Create();
                powerShell.AddScript(@"dotnet build -c debug ""D:\GoodbyteTestingProjects\ForFileSeekIssue\ForFileSeekIssueExe\ForFileSeekIssueExe.sln""");
                powerShell.AddCommand("Out-String");
                PSDataCollection<PSObject> outputCollection = new PSDataCollection<PSObject>();
                powerShell.Streams.Error.DataAdded += (sender, o) =>
                {
                    if (sender != null) errMessageOfPowerShell = ((PSDataCollection<ErrorRecord>)sender)[o.Index]. ToString();
                };
                IAsyncResult result = powerShell.BeginInvoke<PSObject, PSObject>(null, outputCollection);

                 powerShell.EndInvoke(result);
                int errorCount = powerShell.Streams.Error.Count;

               Collection<ErrorRecord> errors = powerShell.Streams.Error.ReadAll();

                bool isErrorOccurred = powerShell.HadErrors;
```

In Short >>

When we call the ‘MSBuildLocator.RegisterDefaults();’ line BEFORE we call the 'Dotnet Build' in Powershell;

It Gives SUCCESS in the Powershell Message, even if there is a Build Error.

When Build is Successful, ‘. HadErrors’ still has the value TRUE.

(Note: ‘. HadErrors’ is TRUE in both the above cases.)

But, if we DO NOT HAVE THE ‘MSBuildLocator.RegisterDefaults();’ line, then Everything works perfectly.


