### Expected Behavior

In Short >>

When we call the ‘MSBuildLocator.RegisterDefaults();’ line BEFORE we call the 'Dotnet Build' in Powershell;

It Gives SUCCESS in the Powershell Message, even if there is a Build Error.

When Build is Successful, ‘. HadErrors’ still has the value TRUE.

(Note: ‘. HadErrors’ is TRUE in both the above cases.)

But, if we DO NOT HAVE THE ‘MSBuildLocator.RegisterDefaults();’ line, then Everything works perfectly.


### Actual Behavior

In Short >>

When we call the ‘MSBuildLocator.RegisterDefaults();’ line BEFORE we call the 'Dotnet Build' in Powershell;

